use rust_mnist::{print_image, Mnist};
use std::thread;

pub fn evaluate(output : bool) {
  let mnist = Mnist::new("../MNIST/");
  if output {
    display_one(&mnist.train_data, &mnist.train_labels, 5);
  }

  // classify all images in the test set
  let mut correct = 0;
  for i in 0..mnist.test_data.len() {
    let img = &mnist.test_data[i];
    let label = mnist.test_labels[i];
    let prediction = classify(img);
    if prediction == label as usize {
      correct += 1;
    }
  }
  if output {
    println!("Accuracy: {}", correct as f32 / mnist.test_data.len() as f32);
  }
}

fn classify(img: &[u8; 784]) -> usize {
  let mut probabilities = vec![0.0; 10];

  let classifiers = [
    classifier0, classifier1, classifier2, classifier3, classifier4,
    classifier5, classifier6, classifier7, classifier8, classifier9
  ];

  for classifier in &classifiers {
    let img_prob = classifier(&img);
    for i in 0..10 {
      probabilities[i] += img_prob[i];
    }
  }

  // get argmax of probabilities (unnormalized)
  let mut max = 0.0;
  let mut max_index = 0;
  for i in 0..10 {
    if probabilities[i] > max {
      max = probabilities[i];
      max_index = i;
    }
  }
  max_index
}

pub fn evaluate_threaded(output : bool) {
  let mnist = Mnist::new("../MNIST/");
  if output {
    display_one(&mnist.train_data, &mnist.train_labels, 5);
  }

  // classify all images in the test set
  let mut correct = 0;
  for i in 0..mnist.test_data.len() {
    let img = &mnist.test_data[i];
    let label = mnist.test_labels[i];
    let prediction = classify_threaded(img);
    if prediction == label as usize {
      correct += 1;
    }
  }

  if output {
    println!("Accuracy: {}", correct as f32 / mnist.test_data.len() as f32);
  }
  
}

pub fn test_threaded() {
  let mut threads = vec![];
  for i in 0..10 {
    let thread = thread::spawn(move || {
      do_something(i);
    });
    threads.push(thread);
  }
  println!("Threads created");
  for thread in threads {
    thread.join().unwrap();
  }
  println!("Threads joined");
}

fn do_something(val: i32) -> () {
  println!("val: {}", val);
}

fn classify_threaded(img: &[u8; 784]) -> usize {
  let mut probabilities = vec![0.0; 10];

  let classifiers = [
    classifier0, classifier1, classifier2, classifier3, classifier4,
    classifier5, classifier6, classifier7, classifier8, classifier9
  ];

  let mut threads = vec![];

  for classifier in &classifiers {
    let img = *img;
    let classifier = *classifier;
    let thread = thread::spawn(move || {
      classifier(&img)
    });
    threads.push(thread);
  }

  for thread in threads {
    let img_prob = thread.join().unwrap();
    for i in 0..10 {
      probabilities[i] += img_prob[i];
    }
  }

  // get argmax of probabilities (unnormalized)
  let mut max = 0.0;
  let mut max_index = 0;
  for i in 0..10 {
    if probabilities[i] > max {
      max = probabilities[i];
      max_index = i;
    }
  }
  max_index
}

fn display_one(data: &Vec<[u8; 784]>, labels: &Vec<u8>, index: usize) -> () {
  let img = data[index];
  let label = labels[index];
  print_image(&img, label);
  println!("Predicted: {}", classify(&img));
}

